import React from 'react';
import Header from '../Header'
import Content from '../Content'
import Content2 from '../Content2'
import Map from '../Map'
import Highlight from '../Highlight'
import Zugangsdichte from '../charts/Zugangsdichte'
import LivingOnline from '../charts/Mobilnutzung'
import NutzungsGründe from '../charts/Nutzungsgründe'
import IktBeschäftigung from '../charts/IKTBeschäftigung'
import HighInternetnutzung from '../charts/HighlightInternet'
import '../../styles/content.css';

export default function Menschen() {

    return(
    <div className="Wrap1">
        <div className="placeholder1"></div>
        <div className="placeholder2"></div>
        <div className="placeholder3"></div>
        <Highlight
        überschrifth3="Übersicht "
        überschrift="Gründe, warum kein Internetzugang besteht" 
                   text="Im Jahr 2019 gaben 46% der Haushalte, die keinen Zugang zum Internet haben, an, das Internet nicht als nützlich anzusehen. Der zweite Hauptgrund ist, dass den betroffenen Personen die erforderlichen Kenntnisse fehlten (44%)."
                   hichart1={
                    < HighInternetnutzung/>
                         }
                   >
       
        </Highlight>
        
        <Header überschrift1="Digitale Wirtschaft" 
                überschrift2="und Gesellschaft"
                boldText="Für viele Menschen in der EU ist die Nutzung des Internets zu einem wichtigen Teil ihres täglichen Lebens geworden."
                normalText="Heutzutage verbringen Menschen einen erheblichen Teil ihrer Zeit aus verschiedenen Gründen online, sei es bei der Arbeit, in der Schule, zu Hause oder unterwegs. Diese digitale Zusammenfassung bietet leicht verständliche Statistiken zu verschiediedenen digitalen Themen und zeigt präsentiert sie anhand von interaktiven Datenvisualisierungen. "
                
                mapchart={
                <Map></Map>
                }
        ></Header>
        <Content überschrift="Zugangsdichte"
                 text=" At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, 
                 no sea takimata sanctus est Lorem <b>ipsum dolor</b> sit amet. At vero eos et accusam et justo duo dolores et ea rebum.
                 At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est  
                 <b> Lorem ipsum</b> dolor sit amet. At vero eos et accusam et justo duo dolores et ea rebum."
                 highlightNumber="46%"
                 erklärungsText="der Haushalte, die keinen Zugang zum Internet haben, gaben an, dass Internet nicht als nützlich anzusehen. Der zweite Hauptgrund ist, dass den betroffenen Personen die erforderlichen Kenntnisse fehlten (44%). "
        ></Content>
        <Content2 chart={
            <Zugangsdichte></Zugangsdichte>
                } chart2={
            <LivingOnline/>
                 } chart3={
            <NutzungsGründe/>
                 } chart4 ={
            <IktBeschäftigung></IktBeschäftigung>
                }

        >
        </Content2>
        </div>


);
    }
